import React from 'react';
import {Navigate, Route, Routes} from 'react-router-dom';
import NotFoundScreen from "../screens/not-found/notFoundScreen";
import AppLayout from "../layouts/app-layout/appLayout";
import AuthLayout from "../layouts/auth-layout/authLayout";
import HomeScreen from "../screens/home/HomeScreen";
import {
    DESIGN_SYSTEM_ROUTE,
    HOME_ROUTE,
    HOW_IT_WORKS_ROUTE,
    INTAKE_FORM_ROUTE,
    NOT_FOUND_ROUTE,
    REGISTER_ROUTE, TEST_RESULT_ROUTE,
    TEST_ROUTE
} from "../constants/RoutesConfig";
import TestScreen from "../screens/test/testScreen";
import RegisterScreen from "../screens/auth/register/RegisterScreen";
import IntakeFormScreen from "../screens/intake-form/IntakeFormScreen";
import TestResultScreen from "../screens/test-result/TestResultScreen";
import HowItWorksScreen from "../screens/how-it-works/HowItWorksScreen";
import DesignSystemScreen from "../screens/design-system/DesignSystemScreen";

export interface NavigatorProps {

}

const Navigator = (props: NavigatorProps) => {

    return (
        <>
            <Routes>
                <Route element={<AppLayout/>}>
                    <Route path={INTAKE_FORM_ROUTE} element={<IntakeFormScreen/>}/>
                    <Route path={TEST_RESULT_ROUTE} element={<TestResultScreen/>}/>
                </Route>
                <Route element={<AuthLayout/>}>
                    <Route path={REGISTER_ROUTE} element={<RegisterScreen/>}/>
                </Route>
                <Route index element={<HomeScreen/>}/>
                {/*<Route path={INTAKE_FORM_ROUTE} element={<IntakeFormScreen/>}/>*/}
                {/*<Route path={INTAKE_FORM_ROUTE} element={<IntakeFormScreen/>}/>*/}
                {/*<Route path={TEST_RESULT_ROUTE} element={<TestResultScreen/>}/>*/}
                <Route path={HOME_ROUTE} element={<HomeScreen/>}/>
                <Route path={HOW_IT_WORKS_ROUTE} element={<HowItWorksScreen/>}/>
                <Route path={TEST_ROUTE} element={<TestScreen/>}/>
                <Route path={DESIGN_SYSTEM_ROUTE} element={<DesignSystemScreen/>}/>
                <Route path={NOT_FOUND_ROUTE} element={<NotFoundScreen/>}/>
                {/*<Route path={HAND_SHAKE} element={<HandShakeComponent/>}/>*/}
                <Route path="*" element={<Navigate to={NOT_FOUND_ROUTE}/>}/>
            </Routes>
        </>
    )
};

export default Navigator;
